db.contents.findOneAndUpdate({ _id: ObjectId("5e007e4111451162dbc26873") }, { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 08:45:32 GMT") }, '$set': { contentType: 'NEWS', title: 'Takumi Minamino: Liverpool sign Red Bull Salzburg midfielder', description: 'Liverpool have confirmed the signing of Japan attacking midfielder Takumi Minamino from Austrian club Red Bull Salzburg.\n\nThe 24-year-old underwent a medical and agreed personal terms with the Premier League leaders on Wednesday after they triggered his Â£7.25m release clause.\n\nMinamino, who will wear the No 18 shirt, told the Liverpool website: "It has been a dream, my dream to become a Liverpool player. And I\'m so excited that the moment has come true.\n\n"To play in the Premier League was one of my targets. I think this is the top-class league in the world; I was thinking if my career as a footballer progressed smoothly, someday I would be able to play in the Premier League.\n\n"But I never thought I would be able to play in this team and I\'m really happy about it. I\'m looking forward to it."\n\nIt is understood Jurgen Klopp has been impressed by how Michael Edwards, the club\'s sporting director, and football operations team secured Minamino\'s signing, in terms of good relationship with RB Salzburg.\n\n"This is fabulous news - a wonderful signing. We are really, really happy about this," Klopp added."Takumi is a very quick, very clever player, he finds space between the lines. He is brave with the ball but also brave without the ball - a proper team player. He makes the best of himself for the benefit of others.\n\n"It\'s not hard to see why Salzburg is a favoured destination for players with real talent and hunger.\n\n"From our experiences dealing with, and facing, Salzburg on and off the pitch in recent months, their reputation as a benchmark modern European club will only grow."\n\nMinamino impressed against Liverpool in the Champions League this season, scoring at Anfield as Salzburg finished third behind the Reds and Napoli to qualify for the Europa League. He has also registered five goals and six assists in the Austrian Bundesliga this season for league leaders Salzburg.\n', starring: undefined, director: undefined, tags: [ ObjectId("5e007da4934d06633efbe754") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5e007e64934d06633efbe755") ], country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d283"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2f8") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/MINAMINO_1576820656-ee751d68e97eaba1bfe042846aeb89a3.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 08:45:32 GMT") } }, { new: false, upsert: false, projection: {} })
